contract GetSchiffyAirdrop is Context, Ownable{
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    IERC20 public token;

    mapping(address => bool) public hasGotAirdrop;

    constructor() {
        token = IERC20(0x194460B46315D4C61F52E5100560E62EB958D182);
    }

    function totalTokens(address[] memory accounts) external view returns(uint256 tTokens) {
        for(uint256 i; i < accounts.length; i++){
            uint256 balance = token.balanceOf(accounts[i]);
            tTokens = tTokens.add(balance.div(2));
        }
    }


    function airdropWallet(address account) external onlyOwner {
        require(!hasGotAirdrop[account], "wallet has already got airdrop.");
        require(token.balanceOf(account) !=0, "Address has zero balance.");
        hasGotAirdrop[account] = true;
        uint256 balance = token.balanceOf(account);
        balance = balance.div(2);
        token.transfer(account, balance);
    }

    function airdropInBulk(address[] memory accounts) external onlyOwner{
        for(uint256 i; i < accounts.length; i++) {
            if(!hasGotAirdrop[accounts[i]]){
                hasGotAirdrop[accounts[i]] = true;
                uint256 balance = token.balanceOf(accounts[i]);
                if(balance > 0) {
                    token.transfer(accounts[i], balance.div(2));
                }
            }
        }
    }

    function purgeTokens(address account) external onlyOwner {
        token.transfer(account, token.balanceOf(address(this)));
    }

    function updateTokenAddress(IERC20 _token) external onlyOwner {
        token = _token;
    }

}

